nit: In general you want to use "$@" instead of $@ here, this takes care of the case where there is a space in one of the parameters, e.g.:

  print_params_1 () {
  for P in $@; do
  printf "%s\n" "$P"
  done
  }

  print_params_2 () {
  for P in "$@"; do
  printf "%s\n" "$P"
  done
  }

  print_params_1 "a fool" # prints "a" then "fool" on 2 lines.
  print_params_2 "a fool" # prints "a fool" on 1 line.

