I still think something is off with these hooks. The way it is now, if you shutdown (go to S5) and then boot the AP (S0), then the sensors will still have the same ODR, range, and res as they had last boot. This doesn't make sense, I think the goals here should be:
  - every time the AP boots, we should have the same default sensor settings.
  - if the AP goes to suspend (S3) and wakes back up (S0) the settings shall not have changed.
  - in S3, and in S5, only sample specific sensors that are needed.

  The last two goals are currently met, but not the first.

  I think you can fix it by changing clock_chipset_shutdown() above to:
  for (i = 0; i < motion_sensor_count; i++) {
  sensor = &motion_sensors[i];
  sensor->active = SENSOR_ACTIVE_S5;
  sensor->state = SENSOR_NOT_INITIALIZED;
  sensor->odr = sensor->default_odr;

  if ((sensor->state == SENSOR_INITIALIZED) &&
  !(sensor->active_mask & sensor->active)) {
  sensor->drv->set_data_rate(sensor, 0, 0); 
  }
  }

